import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
      <div>
        <div><Menu /></div>
      <div className="App">
    <ul>FrontEndDev:
     <li>CSS</li>
     <li>HTML</li>
     <li>JavaScript</li>
     <li>React</li>
    </ul>
      </div>
      <div><Header /></div>
        </div>
    );
}

const Header = () => {
    return (
      <div>
    <ul>BackEndDev:
     <li>Node</li>
     <li>PHP</li>
     <li>MySQl</li>
    </ul>
      </div>
    );
}

const Menu = () => {
  return (
    <div>
      <div>Home</div>
      <div>Yandex</div>
      <div>Google</div>
    </div>
  )
}



export default App;
